import React from "react";
import Chart from "chart.js";

export default function Analytics() {
  React.useEffect(() => {
    var config = {
      type: "line",
      data: {
        labels: [
          "January",
          "February",
          "March",
          "April",
          "May",
          "June",
          "July",
        ],
        datasets: [
          {
            label: new Date().getFullYear(),
            backgroundColor: "#3182ce",
            borderColor: "#3182ce",
            data: [65, 78, 66, 44, 56, 67, 75],
            fill: false,
          },
          {
            label: new Date().getFullYear() - 1,
            fill: false,
            backgroundColor: "#ed64a6",
            borderColor: "#ed64a6",
            data: [40, 68, 86, 74, 56, 60, 87],
          },
        ],
      },
      options: {
        maintainAspectRatio: false,
        responsive: true,
        title: {
          display: false,
          text: "Sales Charts",
          fontColor: "white",
        },
        legend: {
          labels: {
            fontColor: "white",
          },
          align: "end",
          position: "bottom",
        },
        tooltips: {
          mode: "index",
          intersect: false,
        },
        hover: {
          mode: "nearest",
          intersect: true,
        },
        scales: {
          xAxes: [
            {
              ticks: {
                fontColor: "rgba(255,255,255,.7)",
              },
              display: true,
              scaleLabel: {
                display: false,
                labelString: "Month",
                fontColor: "white",
              },
              gridLines: {
                display: false,
                borderDash: [2],
                borderDashOffset: [2],
                color: "rgba(33, 37, 41, 0.3)",
                zeroLineColor: "rgba(0, 0, 0, 0)",
                zeroLineBorderDash: [2],
                zeroLineBorderDashOffset: [2],
              },
            },
          ],
          yAxes: [
            {
              ticks: {
                fontColor: "rgba(255,255,255,.7)",
              },
              display: true,
              scaleLabel: {
                display: false,
                labelString: "Value",
                fontColor: "white",
              },
              gridLines: {
                borderDash: [3],
                borderDashOffset: [3],
                drawBorder: false,
                color: "rgba(255, 255, 255, 0.15)",
                zeroLineColor: "rgba(33, 37, 41, 0)",
                zeroLineBorderDash: [2],
                zeroLineBorderDashOffset: [2],
              },
            },
          ],
        },
      },
    };
    var ctx = document.getElementById("line-chart").getContext("2d");
    window.myLine = new Chart(ctx, config);
  }, []);
  return (
    <>
      <div className="flex flex-wrap w-full justify-between pt-0 mt-0 items-center">
        <div className="px-24 py-4 bg-dark-gray rounded">
          <h1 className="text-white">Kirim:</h1>
        </div>
        <div className="px-24 py-4 bg-dark-purple rounded">
          <h1 className="text-white">Chiqim:</h1>
        </div>
        <div className="px-24 py-4 bg-dark-purple rounded">
          <h1 className="text-white">Summa:</h1>
        </div>
        <div className="px-24 py-4 bg-dark-purple rounded">
          <h1 className="text-white">Jami:</h1>
        </div>
      </div>

      <div className=" relative flex flex-col min-w-0 break-words w-full mb-6 shadow-lg rounded bg-gray-800 mt-6">
        <div className="rounded-t mb-0 px-4 py-3 bg-transparent"></div>
        <div className="p-4 flex-auto">
          <div className="relative h-[500px]">
            <canvas
              className="max-w-full bg-dark-gray-800"
              id="line-chart"
            ></canvas>
          </div>
        </div>
      </div>
    </>
  );
}
